import React, { useState } from 'react';
import PropTypes from 'prop-types';
import unified from 'unified';
import parse from "remark-parse";
import remark2react from "remark-react";
import emoji from 'remark-emoji';
import './AnnoncesGL.css';




export default function AnnoncesGL() {
    const [text, setText] = useState(`# Hello World!
    I :heart: remark-emoji
    
    Also Emoticons are supported :-) (if enabled)
    `);

    return(
        <div className="AnnoncesGL">
            
            <div>
        {
          unified()
            .use(parse)
            .use(remark2react)
            .use(emoji, {
              padSpaceAfter: false, // defaults to false
              emoticon: true // defaults to false
            })
            .processSync(text).contents
        }
      </div>
        </div>
    );
}
